import { SkeletonPage, SkeletonBodyText } from "@shopify/polaris";

function LoadingScreen() {
  return (
    <SkeletonPage primaryAction>
      <SkeletonBodyText />
    </SkeletonPage>
  );
};

function LoadingText() {
  return (
      <SkeletonBodyText />
  );
};

export {LoadingScreen, LoadingText}
